		comments = [
			'Langage cr par <strong>Rasmus Lerdorf</strong>, dveloppeur groenlandais et canadien',
			'Il s\'est demand en <strong>1994</strong> comment enregistrer des infos sur les visiteurs de son CV',
			'Il a cr une bibliothque logicielle et y a ajouter des fonctionnalits pour communiquer avec les bases de donnes, faire des pages dynamiques',
			'Publication <strong>ouverte</strong> du code en <strong>1995</strong> sous le nom PHP/FI',
			'Le code est rcrit en <strong>1997</strong> pour la version 3 et PHP renomm.',
			'PHP permet de faire du HTML, grer les formulaires, les cookies',
			'PHP permet de faire beaucoup d\'autres choses',
			'PHP tourne sur de nombreux systmes d\'exploitation'
		],
		imgTag = '<img src="data:image/svg+xml;base64,%BASE64%">',
		imgIndex = 0,
		divImg = document.getElementById('img'),
		divComment = document.getElementById('comment'),
		divNumber = document.getElementById('number');

		// initialisation premire image
		updateImg();

		document.addEventListener("keydown", keydownUpdateImg, false);

		function keydownUpdateImg(e) {
			switch (e.keyCode) {
				// touche debut
				case 36:
					imgIndex = 0;
					break;
				
				// touche fin
				case 35:
					imgIndex = img.length - 1;
					break;

				// espace
				case 32:
				// flche ->
				case 39:
					imgIndex++;
					if (imgIndex >= img.length) {
						imgIndex = img.length - 1;
						return;
					}
					break;
				
				// flche <-
				case 37:
					imgIndex--;
					if (imgIndex < 0) {
						imgIndex = 0;
						return;
					}
					break;

				default:
					return;
			}
			updateImg();
		}

		function updateImg() {
			divImg.innerHTML = imgTag.replace('%BASE64%', img[imgIndex]);
			divNumber.innerText = (imgIndex + 1) + '/' + img.length;

			divComment.innerHTML = (imgIndex >= 0 && imgIndex < comments.length) ? comments[imgIndex] : '';
		}
	</script>
